import React from "react";

function Courses({ subject }) {
  console.log(subject.courses);
  return (
    <div>
      <h2>
        {subject.courses.map((course) => {
          <h3>{course.name}</h3>;
        })}
      </h2>
    </div>
  );
}

export default Courses;
